INSERT INTO `empreendimentos` (`Id_int`, `Referencia_txf`, `Nome_tit`, `Nome_url`, `Valor_txf`, `Descricao_curta_txa`, `Descricao_txa`, `Endereco_txf`, `Bairro_txf`, `Cidade_txf`, `Estado_est`, `Cep_txf`, `Mapa_txf`, `Mapa360_vin`, `Imagens_ico`, `Videos_vid`, `Exibe_inicio_sel`, `Ordenacao_txf`, `Ativo_sel`) VALUES
(3,	'',	'Residencial Mariah',	'residencial-mariah',	'393000',	'<span id=\"docs-internal-guid-cbd650ac-7fff-6991-66ba-ab08ce66498f\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Localizado na Avenida Papa Jo&atilde;o XXIII, no bairro Ypiranga o empreendimento fica&nbsp; a poucos minutos do centro de Lages. </span></span><div><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span></span></div><div><div dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Utilizando das t&eacute;cnicas construtivas, o projeto arquitet&ocirc;nico e a edifica&ccedil;&atilde;o do Residencial Mariah d&aacute; aos seus moradores privacidade, seguran&ccedil;a e a melhor orienta&ccedil;&atilde;o solar dispon&iacute;vel, tornando o apartamento mais quente durante os invernos e refrescando-os com ventila&ccedil;&atilde;o durante os ver&otilde;es.</span></div></div>',	'<b>Diferenciais:&nbsp;</b><div><br></div><div><ul><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Elevador;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Acessibilidade em todo o Empreendimento;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Medidores individuais de &aacute;gua, g&aacute;s e energia</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">&nbsp;</span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Sal&atilde;o de festas mobiliado com espa&ccedil;o gourmet e churrasqueira a carv&atilde;o (34,95m&sup2;);</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Espa&ccedil;o zen com descansos;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Playground do condom&iacute;nio e aparelhos de alongamento;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Sacada com churrasqueira a carv&atilde;o e vista panor&acirc;mica da cidade;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Forro em gesso em todo apartamento;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Ilumina&ccedil;&atilde;o em LED nas sacadas frontais;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Tratamento ac&uacute;stico na laje;</span></li><li><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Infraestrutura para aquecedor de &aacute;gua a g&aacute;s;</span></li><li>Chuveiro com acionamento por monocomando.<br></li></ul></div>',	'Avenida Papa João XXIII',	'Ypiranga',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'1',	'SIM'),
(4,	'',	'Residencial Terra',	'residencial-terra',	'515000',	'Bem vindo ao Terra, um empreendimento com sacadas amplas, vista panor&acirc;mica da cidade, apartamentos separados por paredes duplas e laje tratada acusticamente, assegurando privacidade aos moradores.<div><br></div><div>O residencial possui apartamentos de dois a tr&ecirc;s quartos, com homebox privativo, vaga de garagem coberta e est&aacute; pronto para receber voc&ecirc;! O Terra est&aacute; localizado na Rua Edson Luiz Dalforno 155, no bairro Frei Rog&eacute;rio.</div>',	'<b>Diferenciais:</b><div><br></div><div><ul><li>Elevador;</li><li>Medidores individuais de &aacute;gua, g&aacute;s e energia;</li><li>Sal&atilde;o de festas com espa&ccedil;o gourmet e churrasqueira - decorado, mobiliado e climatizado;</li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Brinquedoteca;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Deck de madeira com espa&ccedil;o zen;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Sacada com churrasqueira a carv&atilde;o e bancada de apoio com pia;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Acabamento do forro em gesso em todo apartamento;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Infraestrutura para aquecedor de &aacute;guas a g&aacute;s;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Janelas com persianas automatizadas com acionamento por controle remoto nos dormit&oacute;rios;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Chuveiros com acionamento por monocomando.</span></span></li></ul></div>',	'R. Edson Luiz Dalforno 155',	'Frei Rogério',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'2',	'SIM'),
(5,	'',	'Residencial Centenário',	'residencial-centenario',	'210000',	'<span style=\"white-space: pre-wrap;\">Para voc&ecirc; que sonha em sair do aluguel, o Centen&aacute;rio &eacute; o lugar ideal para voc&ecirc;! O empreendimento faz parte do programa \"Minha casa, Minha vida\", e possui projeto inovador.</span><div><span style=\"white-space: pre-wrap;\"><br></span></div><div><span style=\"white-space: pre-wrap;\">O empreendimento possui seguran&ccedil;a e espa&ccedil;o voltado para recrea&ccedil;&atilde;o das fam&iacute;lias, sem encarecer o condom&iacute;nio. Localizado no Bairro Centen&aacute;rio a 5 minutos do centro.</span></div>',	'<b>Diferenciais:</b><div><br></div><div><ul><li>Apartamento com&nbsp;<span id=\"docs-internal-guid-4d3b72ec-7fff-60d1-0a9a-bcb4a623d745\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">51m&sup2; e 53m&sup2;;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Dois dormit&oacute;rios;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Churrasqueira a carv&atilde;o na sacada;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Estacionamento pavimentado;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Todos os apartamentos com excelente orienta&ccedil;&atilde;o solar;</span></span></li><li><span><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Portaria;</span></span></li><li>&Aacute;rea de recep&ccedil;&atilde;o com estares;</li><li>Playground;</li><li>Quiosque com churrasqueira a carv&atilde;o.</li></ul></div>',	'',	'Centenário',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'3',	'SIM'),
(6,	'',	'Residencial Távora Tigre',	'residencial-tavora-tigre',	'333000',	'More em um local tranquilo, em um bairro exclusivamente residencial.<br><br>Localizado na rua T&aacute;vora Tigre, bairro Ypiranga, o Residencial T&aacute;vora Tigre se destaca pela sua arquitetura, sendo dois apartamentos por andar e excelente orienta&ccedil;&atilde;o solar.<div><div><br></div><div>Projeto sofisticado, com planta de dois quartos com su&iacute;te, pronto para morar.</div></div>',	'<b>Diferenciais:</b><div><br></div><div><ul><li>Apartamento dois dormit&oacute;rios;</li><li>Localiza&ccedil;&atilde;o privilegiada com acesso r&aacute;pido ao centro;</li><li>Apartamentos com vista privilegiada e excelente posi&ccedil;&atilde;o solar;</li><li>Vizinho de &aacute;rea de preserva&ccedil;&atilde;o ambiental;</li><li>Dois apartamentos por andar;</li><li>Medidores individuais de &aacute;gua, g&aacute;s e energia;</li><li>Acabamento de forro em gesso;</li><li>Piso porcelanato na sala. cozinha e banheiros e laminado nos quartos;</li><li>Sacada com churrasqueira a carv&atilde;o;</li><li>Vagas de garagem coberta com hobby box;</li><li>Janelas com persianas nos dormit&oacute;rios.</li></ul></div>',	'R. Távora Tigre',	'Ypiranga',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'4',	'SIM'),
(8,	'',	'Residencial Mirante da Boa Vista',	'residencial-mirante-da-boa-vista',	'257000',	'<div style=\"margin-bottom: 15px;\" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><div class=\"MsoNormal\">O residencial Mirante da Boa Vista &eacute; a escolha perfeita para\r\nquem procura um lugar pr&oacute;ximo do Centro com excelentes possibilidades de\r\nfinanciamento e acabamento de qualidade, a sua oportunidade para realizar o\r\nsonho da casa pr&oacute;pria!<o:p></o:p></div><div class=\"MsoNormal\"><br></div>\r\n\r\n<div class=\"MsoNormal\">O pr&eacute;dio fica no alto da avenida Papa Jo&atilde;o XXIII com vista\r\npanor&acirc;mica da cidade, localiza&ccedil;&atilde;o privilegiada e de r&aacute;pido acesso ao Centro - o\r\ncondom&iacute;nio oferece conforto, privacidade e isolamento ac&uacute;stico utilizando\r\nmodernas t&eacute;cnicas construtivas.<o:p></o:p></div><br></div>',	'<div style=\"margin-bottom: 15px;\" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><div class=\"MsoNormal\"><b>Diferenciais:</b><o:p></o:p></div><div class=\"MsoNormal\"><br></div>\r\n\r\n<div class=\"MsoNormal\"><ul><li>Apartamentos de dois dormit&oacute;rios de 57m&sup2; e 63m&sup2;;</li><li>Disponibilidade de apartamentos com su&iacute;te;</li><li>Vagas de garagem cobertas com possibilidade de hobby box privativo;</li><li>Churrasqueira a carv&atilde;o na sacada;</li><li>Piso de porcelanato em todo apartamento;</li><li>Acabamento de forro em gesso;</li><li>Sal&atilde;o de festas climatizado e mobiliado com churrasqueira a\r\ncarv&atilde;o;</li><li>Paisagismo completo do condom&iacute;nio;</li><li>Playground do condom&iacute;nio.</li></ul><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div><br></div>',	'Avenida Papa João XXIII',	'',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'5',	'SIM');
