(11,	'compra',	'CA 001',	'Casa alvenaria próxima ao centro',	'casa-alvenaria-proxima-ao-centro',	'Casa em alvenaria, com&nbsp;3 quartos sendo 1 su&iacute;te, 3 banheiros, sala, cozinha, churrasqueira gourmet, lavanderia independente e 2 vagas de garagem.',	'Casa alvenaria, pr&oacute;xima ao centro, possui vizinhan&ccedil;a tranquila e excelente posi&ccedil;&atilde;o solar.<div><br></div><div><b>REF: CA 001</b></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'500000',	'R. Pernambuco',	'São Cristóvão',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'SIM',	'SIM',	'1'),
(12,	'compra',	'AP 002',	'Apartamento ',	'apartamento',	'Apartamento com&nbsp;2 quartos, 1 banheiro, cozinha mobiliada e 1 vaga de garagem.',	'&Oacute;tima oportunidade para investimento!&nbsp;Apartamento pr&oacute;ximo a Unifacvest, excelente im&oacute;vel para loca&ccedil;&atilde;o.<div><br></div><div><b>REF: AP 002</b></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'260000',	'R. Thiago Vieira de Castro 56, apto 301',	'Triângulo',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'NAO',	'SIM',	'2'),
(14,	'compra',	'AP 001',	'Cobertura Duplex ',	'cobertura-duplex',	'<div class=\"MsoNormal\">Cobertura com 2 su&iacute;tes, 1 lavabo, 2 salas, cozinha gourmet, jacuzzi, 2 vagas de garagem, mobiliada.</div><div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>',	'<div class=\"MsoNormal\">Linda Cobertura Duplex com 150m&sup2;, finamente decorado e equipado, possui excelente vista da cidade, &oacute;tima\r\nposi&ccedil;&atilde;o solar, espa&ccedil;o externo super agrad&aacute;vel. Edif&iacute;cio moderno, com porteiro eletr&ocirc;nico e sal&atilde;o de festa todo equipado, pronto para receber os seus convidados.</div><div class=\"MsoNormal\"><b><br></b></div><div class=\"MsoNormal\"><b>REF: AP 001</b></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'1100000',	'R. Rio Grande do Norte',	'São Cristóvão',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'SIM',	'SIM',	'4'),
(15,	'compra',	'CA 005',	'Casa Alvenaria',	'casa-alvenaria',	'A casa possui 02 dormit&oacute;rios com su&iacute;te, 1 banheiro (lavabo), cozinha, &aacute;rea de servi&ccedil;o, hall de entrada, sala, churrasqueira, sacada, duas vagas de garagem, espa&ccedil;o verde com jardim de inverno com &aacute;rvores frut&iacute;feras e fogo de ch&atilde;o.&nbsp;<br><br>',	'Lindo im&oacute;vel, estilo casa de campo, a poucos minutos do centro, super aconchegante, com &oacute;tima posi&ccedil;&atilde;o solar e um lindo jardim de inverno.<div><br></div><div><b>REF: CA 005</b></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'620000',	'Rua Porto Alegre',	'Santa Helena',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'SIM',	'SIM',	''),
(18,	'compra',	'AP 003',	'Apartamento',	'apartamento',	'<div>O im&oacute;vel possui 2 quartos, cozinha mobiliada, sala, banheiro, vaga de garagem com espa&ccedil;o para at&eacute; 3 carros.&nbsp;</div>',	'Apartamento pr&oacute;ximo &agrave; UNIPLAC, a poucos minutos do Centro.&nbsp; Excelente op&ccedil;&atilde;o para moradia ou para loca&ccedil;&atilde;o e aceita financiamento ou troca.<div><br></div><div><b>REF: AP 003</b></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'259000',	'Rua Joaquim Nabuco',	'Caravaggio',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'NAO',	'NAO',	'SIM',	''),
(19,	'compra',	'CA 004',	'Casa dois pavimentos',	'casa-dois-pavimentos',	'Casa com dois pavimentos,&nbsp;3 dormit&oacute;rios (sendo uma su&iacute;te), espa&ccedil;o gourmet,&nbsp;3 banheiros, sala de estar, home office, cozinha ampla e &aacute;rea de servi&ccedil;o.',	'Casa com excelente posi&ccedil;&atilde;o solar, rec&eacute;m pitado,&nbsp;todo murado, com cal&ccedil;ada, possui tamb&eacute;m alarme e cerca el&eacute;trica. O im&oacute;vel conta com&nbsp;&nbsp;360m&sup2; de terreno e 200m&sup2; de &aacute;rea constru&iacute;da. <b>Aceita financiamento</b><div><b><br></b></div><div><b>REF: CA 004</b></div><div><b><br></b></div><div><br></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'500000',	'Rua Jorge Neves Vieira',	'Bairro São Luíz',	'Lages',	'Santa Catarina',	'',	'!1m18!1m12!1m3!1d3528.1764006954763!2d-50.34435888493517!3d-27.83511148273922!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x94e01f66e113dec7%3A0x2304aeca3317c1a2!2sR.%20Jorge%20Neves%20Vi%C3%AAira%2C%20Lages%20-%20SC!5e0!3m2!1spt-BR!2sbr!4v1607395387234!5m2!1spt-BR!2sbr',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'SIM',	'SIM',	''),
(20,	'compra',	'AP 004',	'Cobertura Duplex em área central',	'cobertura-duplex-em-area-central',	'Cobertura duplex em &aacute;rea central, possui&nbsp;3 su&iacute;tes sendo uma com closet e hidromassagem, 2 lavabos, cozinha,&nbsp;2 salas, terra&ccedil;o, churrasqueira gourmet e 2 vagas&nbsp;de garagem - cabe at&eacute; 3 carros.',	'More no Centro de Lages com toda a comodidade que voc&ecirc; merece! Excelente im&oacute;vel semi-mobiliado em condom&iacute;nio com &oacute;tima infraestrutura, conta com academia, brinquedoteca, playground, sal&atilde;o de festa com churrasqueira. Agende sua visita conosco e se encante com esse im&oacute;vel!&nbsp;',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'980000',	'Rua Lauro Müller',	'Centro',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'SIM',	'SIM',	''),
(21,	'compra',	'Ap 005',	'Apartamento no Residencial  Centenário',	'apartamento-no-residencial-centenario',	'<div>Apartamento semi mobiliado a poucos minutos do Centro. O im&oacute;vel possui: 2 quartos, 1 banheiro, sala, cozinha, sacada com churrasqueira, 1 vaga de garagem, forro em gesso e porcelanato.</div><div><br></div>',	'Excelente oportunidade para quem busca um im&oacute;vel pr&oacute;ximo ao Centro. O apartamento est&aacute; semi mobiliado, com m&oacute;veis sob medida, em excelente estado. O condom&iacute;nio conta com sal&atilde;o de festas, parque infantil e acesso por rua asfaltada. <b>Aceita financiamento!</b><div><br></div><div><b>REF: AP 004</b></div>',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'225.000',	' Rua Glicério Pereira, nº 240',	'Centenário',	'Lages',	'Santa Catarina',	'',	'',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM',	'SIM',	'SIM',	'');
