(707,	221,	'Efetuado UPDATE do campo <b>Sobre_txa</b> com o valor = <b>Com ampla experi&ecirc;ncia no ramo imobili&aacute;rio, trabalho sempre de forma transparente e com disposi&ccedil;&atilde;o para buscar conhecimento de todos os empreendimentos os quais trabalho, podendo assim, trazer solu&ccedil;&otilde;es para atender as necessidades de cada cliente. Seja ele buscando realizar o sonho da casa pr&oacute;pria ou mesmo o investimento certo e seguro com resultados satisfat&oacute;rios. Al&eacute;m disso, estou sempre atento a todas as novidades referente a cr&eacute;dito imobili&aacute;rio, ofertante aos meus compradores as melhores formas de pagamento.<div><br></div><div>Meus clientes possuem acompanhamento durante todo o processo de compra, desde a escolha do im&oacute;vel, todo o procedimento de documenta&ccedil;&atilde;o, visitas &agrave; obra, at&eacute; a entrega das chaves.</div></b> e o seu registro <b>Id_int = 1</b> da tabela <b>sobre_mim</b>',	'sobre_mim',	'2020-11-25',	'19:11:01',	'5'),
