(926,	1,	'Efetuado UPDATE do campo <b>Nome_tit</b> com o valor = <b>Residencial Mirante da Boa Vista</b> e o seu registro <b>Id_int = 8</b> da tabela <b>empreendimentos</b>',	'empreendimentos',	'2020-11-26',	'15:11:42',	'3'),
(927,	1,	'Efetuado UPDATE do campo <b>Descricao_curta_txa</b> com o valor = <b><div style=\"margin-bottom: 15px;\" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><div class=\"MsoNormal\">O residencial Mirante da Boa Vista &eacute; a escolha perfeita para\r\nquem procura um lugar pr&oacute;ximo do Centro com excelentes possibilidades de\r\nfinanciamento e acabamento de qualidade, a sua oportunidade para realizar o\r\nsonho da casa pr&oacute;pria!<o:p></o:p></div><div class=\"MsoNormal\"><br></div>\r\n\r\n<div class=\"MsoNormal\">O pr&eacute;dio fica no alto da avenida Papa Jo&atilde;o XXIII com vista\r\npanor&acirc;mica da cidade, localiza&ccedil;&atilde;o privilegiada e de r&aacute;pido acesso ao Centro - o\r\ncondom&iacute;nio oferece conforto, privacidade e isolamento ac&uacute;stico utilizando\r\nmodernas t&eacute;cnicas construtivas.<o:p></o:p></div><br></div></b> e o seu registro <b>Id_int = 8</b> da tabela <b>empreendimentos</b>',	'empreendimentos',	'2020-11-26',	'15:11:33',	'3'),
(928,	1,	'Efetuado UPDATE do campo <b>Descricao_txa</b> com o valor = <b><div style=\"margin-bottom: 15px;\" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><div class=\"MsoNormal\"><b>Diferenciais:</b><o:p></o:p></div><div class=\"MsoNormal\"><br></div>\r\n\r\n<div class=\"MsoNormal\"><ul><li>Apartamentos de dois dormit&oacute;rios de 57m&sup2; e 63m&sup2;;</li><li>Disponibilidade de apartamentos com su&iacute;te;</li><li>Vagas de garagem cobertas com possibilidade de hobby box privativo;</li><li>Churrasqueira a carv&atilde;o na sacada;</li><li>Piso de porcelanato em todo apartamento;</li><li>Acabamento de forro em gesso;</li><li>Sal&atilde;o de festas climatizado e mobiliado com churrasqueira a\r\ncarv&atilde;o;</li><li>Paisagismo completo do condom&iacute;nio;</li><li>Playground do condom&iacute;nio.</li></ul><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div>\r\n\r\n<div class=\"MsoNormal\"><o:p></o:p></div><br></div></b> e o seu registro <b>Id_int = 8</b> da tabela <b>empreendimentos</b>',	'empreendimentos',	'2020-11-26',	'15:11:07',	'3'),
