(965,	1,	'Efetuado UPDATE do campo <b>Sobre_txa</b> com o valor = <b>Com ampla experi&ecirc;ncia no ramo imobili&aacute;rio, trabalhamos sempre de forma transparente e com disposi&ccedil;&atilde;o para buscar conhecimento de todos os empreendimentos do nosso porrif&oacute;lio, podendo assim, trazer solu&ccedil;&otilde;es para atender as necessidades de cada cliente. Seja ele buscando realizar o sonho da casa pr&oacute;pria ou mesmo o investimento certo e seguro com resultados satisfat&oacute;rios.<div><br></div><div>Al&eacute;m disso, estamos atentos a todas as novidades referente a cr&eacute;dito imobili&aacute;rio, ofertando aos meus compradores as melhores formas de pagamento.<div><br></div><div>Nossos clientes possuem acompanhamento durante todo o processo de compra, desde a escolha do im&oacute;vel, todo o procedimento de documenta&ccedil;&atilde;o, visitas &agrave; obra a entrega das chaves.</div></div></b> e o seu registro <b>Id_int = 1</b> da tabela <b>sobre_mim</b>',	'sobre_mim',	'2020-11-26',	'16:11:13',	'3'),
(966,	1,	'Efetuado UPDATE do campo <b>Titulo_txf</b> com o valor = <b>Somos apaixonados pelo que fizemos!</b> e o seu registro <b>Id_int = 1</b> da tabela <b>sobre_carreira</b>',	'sobre_carreira',	'2020-11-26',	'16:11:23',	'3'),
