(2399,	226,	'Efetuado UPDATE do campo <b>Texto_txa</b> com o valor = <b><div><div><span id=\"docs-internal-guid-11ac5704-7fff-d4fd-057a-0801e8e02116\"><div dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">A Hubvet Im&oacute;veis nasceu do entusiasmo de ajudar pessoas a encontrarem o seu melhor lugar. Nossa miss&atilde;o &eacute; a satisfa&ccedil;&atilde;o do cliente, buscando atender suas reais necessidades, acompanhando n&atilde;o somente na escolha, mas todo o processo burocr&aacute;tico e garantindo uma experi&ecirc;ncia exclusiva na hora de fechar neg&oacute;cios.</span></div><br><div dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Contamos com um time que possui ampla viv&ecirc;ncia no mercado e juntos j&aacute; realizou mais de 170 vendas nos &uacute;ltimos 6 anos, proporcionando aos seus clientes maior seguran&ccedil;a em todas as transa&ccedil;&otilde;es.</span></div></span></div></div></b> e o seu registro <b>Id_int = 1</b> da tabela <b>sobre_missao</b>',	'sobre_missao',	'2021-01-31',	'18:01:18',	'5'),
