INSERT INTO `seo` (`Id_int`, `Pagina_txf`, `Titulo_sma`, `Descricao_sma`, `Keywords_sma`, `Imagem_sma`, `Imagem_ico`, `Ativo_sel`) VALUES
(1,	'default',	'Hubvet Im&oacute;veis - Podemos te ajudar a encontrar sua nova casa?',	'Com ampla experi&ecirc;ncia no ramo imobili&aacute;rio, trabalhamos sempre de forma transparente e com disposi&ccedil;&atilde;o para buscar conhecimento de todos os empreendimentos do nosso porrif&oacute;lio, podendo assim, trazer solu&ccedil;&otilde;es para atender as necessidades de cada cliente. Seja ele buscando realizar o sonho da casa pr&oacute;pria ou mesmo o investimento certo e seguro com resultados satisfat&oacute;rios.',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'',	'SIM'),
(3,	'cadastre-seu-imovel',	'Hubvet Im&oacute;veis - Quer anunciar conosco?',	'Preencha o formul&aacute;rio abaixo e entraremos em contato',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM'),
(4,	'imoveis',	'Hubvet Im&oacute;veis - Podemos te ajudar a encontrar sua nova casa?',	'Nossos clientes possuem acompanhamento durante todo o processo de compra, desde a escolha do im&oacute;vel, todo o procedimento de documenta&ccedil;&atilde;o, visitas &agrave; obra a entrega das chaves.',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM'),
(5,	'empreendimentos',	'Hubvet Im&oacute;veis - Confira as principais op&ccedil;&otilde;es investimentos para voc&ecirc;!',	'Confira as principais op&ccedil;&otilde;es investimentos para voc&ecirc;!',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM'),
(6,	'sobre',	'Hubvet Im&oacute;veis - Ajudamos voc&ecirc; a encontrar o seu melhor lugar!',	'Com ampla experi&ecirc;ncia no ramo imobili&aacute;rio, trabalhamos sempre de forma transparente e com disposi&ccedil;&atilde;o para buscar conhecimento de todos os empreendimentos do nosso porrif&oacute;lio, podendo assim, trazer solu&ccedil;&otilde;es para atender as necessidades de cada cliente. Seja ele buscando realizar o sonho da casa pr&oacute;pria ou mesmo o investimento certo e seguro com resultados satisfat&oacute;rios.',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM'),
(7,	'avalie-seu-imovel',	'Hubvet Im&oacute;veis - Avalie seu im&oacute;vel',	'Se voc&ecirc; est&aacute; pensando em alugar ou vender seu im&oacute;vel n&oacute;s podemos te ajudar.',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM'),
(8,	'contato',	'Hubvet Im&oacute;veis - Entre em contato!',	'Preencha o formul&aacute;rio abaixo e vamos entrar contato',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'SIM'),
(9,	'inicio',	'Hubvet Im&oacute;veis - Podemos te ajudar a encontrar sua nova casa?',	'Com ampla experi&ecirc;ncia no ramo imobili&aacute;rio, trabalhamos sempre de forma transparente e com disposi&ccedil;&atilde;o para buscar conhecimento de todos os empreendimentos do nosso porrif&oacute;lio, podendo assim, trazer solu&ccedil;&otilde;es para atender as necessidades de cada cliente. Seja ele buscando realizar o sonho da casa pr&oacute;pria ou mesmo o investimento certo e seguro com resultados satisfat&oacute;rios.',	'',	'{$app->Url_cliente}{$app->Pasta_painel}/{$banners[0]->Imagens[0]->Caminho_txf}',	'<img rel=\'Visualizar\' src=\'imagens/visualizar_geral.png\' />',	'');
