INSERT INTO `sobre_mim` (`Id_int`, `Titulo_txf`, `Especializacao_txf`, `Sobre_txa`, `Imagens_ico`, `Ativo_sel`) VALUES
(1,	'Ajudamos você a encontrar o seu melhor lugar!',	'Somos especialistas em consultoria imobiliária.',	'Com ampla experi&ecirc;ncia no ramo imobili&aacute;rio, trabalhamos sempre de forma transparente e com disposi&ccedil;&atilde;o para buscar conhecimento de todos os empreendimentos do nosso porrif&oacute;lio, podendo assim, trazer solu&ccedil;&otilde;es para atender as necessidades de cada cliente. Seja ele buscando realizar o sonho da casa pr&oacute;pria ou mesmo o investimento certo e seguro com resultados satisfat&oacute;rios.<div><br></div><div>Al&eacute;m disso, estamos atentos a todas as novidades referente a cr&eacute;dito imobili&aacute;rio, ofertando aos meus compradores as melhores formas de pagamento.<div><br></div><div>Nossos clientes possuem acompanhamento durante todo o processo de compra, desde a escolha do im&oacute;vel, todo o procedimento de documenta&ccedil;&atilde;o, visitas &agrave; obra a entrega das chaves.</div></div>',	'',	'SIM');
