INSERT INTO `vagas` (`Id_int`, `Nome_tit`, `Nome_url`, `Descricao_txa`, `Descricao_interna_txa`, `Numero_vagas_txf`, `Imagem_ico`, `Ordenacao_txf`, `Ativo_sel`) VALUES
(5,	'Estágio Pré-Vendas',	'estagio-pre-vendas',	'<div>O pr&eacute;-vendas tem como objetivo qualificar os leads gerados, devendo ser extremamente competitivo, corajoso, dominante e buscando sempre os melhores resultados!</div>',	'<div>&nbsp;O pr&eacute;-vendas tem como objetivo qualificar os leads gerados, devendo ser extremamente competitivo, corajoso, dominante e buscando sempre os melhores resultados!</div><div><br></div><div><b>Requisitos:</b></div><div>- Estar cursando Administra&ccedil;&atilde;o, Marketing, Processos Gerenciais, Gest&atilde;o Comercial ou algum outro curso pertinente &agrave; fun&ccedil;&atilde;o</div><div>- Boa comunica&ccedil;&atilde;o</div><div>- Experi&ecirc;ncia com vendas por telefone (acima de 6 meses)</div><div>- Ter facilidade em trabalhar com volume</div><div>- Saber trabalhar com ferramentas de busca</div><div>- Facilidade de trabalhar em equipe</div><div>- Persuas&atilde;o</div><div><br></div><div><b>Diferenciais:</b></div><div>- Ter experi&ecirc;ncia com o pacote Office</div><div>- Ser organizado</div><div>- Ser Proativo</div>',	'1',	'SIM',	'',	'SIM'),
(6,	'Estágio Designer Gráfico',	'estagio-designer-grafico',	'Voc&ecirc; curte trabalhar com design gr&aacute;fico e redes sociais? &Eacute; din&acirc;mico, comunicativo e manja dos paranau&ecirc; do photoshop? Essa &eacute; uma oportunidade pra voc&ecirc;!<div><br></div><div><div><b>Voc&ecirc; atuar&aacute;, principalmente, nas seguintes atividades:</b></div><div><ul><li>Cria&ccedil;&atilde;o de material gr&aacute;fico para redes sociais;</li><li>Cria&ccedil;&atilde;o de material gr&aacute;fico para impress&atilde;o;</li><li>Diagrama&ccedil;&atilde;o e estiliza&ccedil;&atilde;o de materiais ricos (e-books, whitepapers, etc.);</li><li>Escutar forr&oacute; e outros g&ecirc;neros musicais n&atilde;o muito populares no sul do Brasil.</li></ul></div><div><b>O que &eacute; indispens&aacute;vel para a vaga:</b></div><div><ul><li>Conhecimentos intermedi&aacute;rios de Photoshop;</li><li>Conhecimento em ferramentas de organiza&ccedil;&atilde;o (Trello);</li><li>Boa comunica&ccedil;&atilde;o;</li><li>Estar disposto a conviver com gostos musicais nada convencionais;</li><li>Conhecimentos b&aacute;sicos de marketing.</li></ul><div><b>Diferenciais:</b></div></div><div><ul><li>Conhecimentos de edi&ccedil;&atilde;o de v&iacute;deo (Adobe Premiere e After Effects);</li><li>Certifica&ccedil;&otilde;es da Rock Content University.</li></ul></div><div><br></div><div>Achou que a vaga combina com voc&ecirc;? Envie o seu curr&iacute;culo!</div></div>',	'<div>Tem vaga nova para est&aacute;gio em Design Gr&aacute;fico na Lands!&nbsp;</div><div><br></div><div>E a&iacute;, voc&ecirc; curte trabalhar com design gr&aacute;fico e redes sociais? &Eacute; din&acirc;mico, comunicativo e manja dos paranau&ecirc; do photoshop? Ent&atilde;o envie seu curr&iacute;culo para a gente no formul&aacute;rio.</div><div><br></div><div>Pr&eacute;-Requisitos:</div><div>&bull; Habilidades avan&ccedil;adas com Photoshop;</div><div>&bull; No&ccedil;&otilde;es de desenho e diagrama&ccedil;&atilde;o;</div><div>&bull; Ser proativo.</div><div><br></div><div>Diferenciais:</div><div>&bull; Habilidades com Illustrator;</div><div>&bull; Habilidades com edi&ccedil;&atilde;o de v&iacute;deo pacote Adobe.</div>',	'1',	'SIM',	'',	'SIM'),
(7,	' Estágio Desenvolvedor',	'estagio-desenvolvedor',	'<span style=\"color: rgb(85, 85, 85); font-family: &quot;open sans&quot;, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Uma oportunidade para voc&ecirc; que gosta de desafios e tem vontade de aprender mais e crescer!</span>',	'',	'1',	'SIM',	'',	'SIM'),
(8,	'Social Media',	'social-media',	'Voc&ecirc; curte trabalhar com redes sociais? Possui MUITA criatividade e gosta de se comunicar? Ent&atilde;o manda seu curr&iacute;culo pra gente!',	'<span style=\"color: rgb(46, 51, 56); font-family: Whitney, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; white-space: break-spaces; background-color: rgba(6, 6, 7, 0.02);\">Tem vaga nova para Social Media na Lands! </span><span class=\"emojiContainer-3X8SvE\" role=\"button\" tabindex=\"0\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: Whitney, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; outline: 0px; display: inline-block; cursor: pointer; color: rgb(46, 51, 56); white-space: break-spaces; background-color: rgba(6, 6, 7, 0.02);\"><img aria-label=\":heart_eyes:\" src=\"https://discord.com/assets/e55f552bd0b1cf368b466422408c8401.svg\" alt=\":heart_eyes:\" draggable=\"false\" class=\"emoji\" style=\"margin: 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: bottom; object-fit: contain; width: 1.375em; height: 1.375em; text-indent: -9999px;\"></span><span style=\"color: rgb(46, 51, 56); font-family: Whitney, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; white-space: break-spaces; background-color: rgba(6, 6, 7, 0.02);\">\r\n\r\nE a&iacute;, voc&ecirc; curte trabalhar com redes sociais? Possui MUITA criatividade e uma &oacute;tima reda&ccedil;&atilde;o? Ent&atilde;o manda seu curr&iacute;culo no formul&aacute;rio dessa p&aacute;gina\r\n</span><span style=\"color: rgb(46, 51, 56); font-family: Whitney, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 16px; white-space: break-spaces; background-color: rgba(6, 6, 7, 0.02);\">\r\nRequisitos:\r\n</span><span class=\"emojiContainer-3X8SvE\" role=\"button\" tabindex=\"0\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: Wh