(9,	'Analista de Marketing',	'analista-de-marketing',	'<span style=\"color: rgb(87, 87, 87); font-family: &quot;open sans&quot;, &quot;helvetica neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Se voc&ecirc; curte An&uacute;ncios pelo Google ou Facebook, SEO, Google Analytics e muita planilha, essa vaga &eacute; para voc&ecirc;!</span>',	'',	'1',	'SIM',	'',	'SIM'),
(10,	'Consultor de Vendas SDR',	'consultor-de-vendas-sdr',	'<div>Voc&ecirc; ama gerar novos neg&oacute;cios? Ent&atilde;o essa &eacute; a sua chance!</div><div>Estamos com vagas abertas de <b>SDR</b> (Sales Development Representative/Pr&eacute;-vendedor), para trabalhar junto ao nosso time de Vendas!</div><div>Buscamos por uma pessoa que seja <b>apaixonada por Marketing</b> e que ame trabalhar em equipe! ??</div><div><br></div><div><b>Voc&ecirc; atuar&aacute;, principalmente, nas seguintes atividades:</b></div><div><ul><li>Identifica&ccedil;&atilde;o, prospec&ccedil;&atilde;o e qualifica&ccedil;&atilde;o de potenciais clientes;</li><li>Opera&ccedil;&atilde;o de sistema CRM;</li><li>Participa&ccedil;&atilde;o de reuni&otilde;es com o time Comercial;</li><li>Agendamento de visitas e reuni&otilde;es;</li><li>A&ccedil;&otilde;es externas voltadas a parcerias e gera&ccedil;&atilde;o de leads.</li></ul></div><div><b>O que &eacute; indispens&aacute;vel para a vaga:</b></div><div><ul><li>Ter &oacute;tima comunica&ccedil;&atilde;o interpessoal, verbal e escrita;</li><li>Ser proativo e persuasivo;</li><li>Conhecimento em pacote Office;</li><li>Forma&ccedil;&atilde;o completa ou cursando Administra&ccedil;&atilde;o, Marketing, Tecnologia ou &aacute;reas similares.</li></ul></div><div>Achou que a vaga combina com voc&ecirc;? Envie o seu curr&iacute;culo!<br></div><div><br></div><div><b>Benef&iacute;cios da vaga:</b></div><div><ul><li>Vale transporte;</li><li>Vale alimenta&ccedil;&atilde;o.</li></ul></div><div>Contrato: CLT Efetivo;</div>',	'',	'1',	'SIM',	'',	'SIM'),
(11,	'Desenvolvedor Web',	'desenvolvedor-web',	'<div><b>Os requisitos para a vaga s&atilde;o:</b></div><div>- Conhecimento intermedi&aacute;rio em HTML, CSS e javascript;</div><div>- E conhecimento intermedi&aacute;rio em PHP.</div><div><br></div><div><b>Algumas caracter&iacute;sticas que podem te diferenciar:</b></div><div>- Conhecer m&eacute;todos &aacute;geis;</div><div>- Saber trabalhar em equipe;</div><div>- Ser proativo e comunicativo;</div><div>- Ter muita vontade de aprender!</div>',	'',	'1',	'SIM',	'',	'SIM');
